sys_variable_value.value:
(function execute(inputs, outputs) {
    var competitors = JSON.parse(inputs.competitors);

    if (competitors) {
        // Convert to array if 'competitors' is a string
        let racers = Array.isArray(competitors) ? competitors : competitors.split(',');

        // Clean the array to remove extraneous quotes and whitespace
        racers = racers.map(racer => racer.trim().replace(/^"|"$/g, '')).filter(racer => racer);

        // Simple random reordering using sort with random comparator
        racers.sort(() => Math.random() - 0.5);

        // Directly assign the randomized array to outputs
        outputs.data = JSON.stringify(racers);
    } else {
        // Define behavior if competitors input is missing
        outputs.data = [];
    }
})(inputs, outputs);

